import React from "react";

const AddToFavouritesButton = (props) => {
    const handleOnClick = () => {
        props.addToFavourites(props.play);
    }

    return (
        <button onClick={handleOnClick}>Fave</button>
    );
};

export default AddToFavouritesButton
